  useEffect(()=>{
    Axios.get('http://localhost:4000/GamoshvebisMult')
    .then((response) => {
      console.log(response.data)
      const data = response.data

      SetGamoshvebisMult(data)
    })
  }, [])

  return (
    <div>
      <MainPage />
      <p>
      </p>
    </div>
  );
}
export default Data;
